function Header() {
  return (
    <header>
      <p id={"logo"}>Logo</p>
      <span id={'right-side'}>
        <Link to={'/'}>Blogs</Link>

        <a href="">About</a>
        <a href="">Contact</a>
      </span>
    </header>
  );
}

export default Header;
